export const ResultScreen = ({ results }) => {
  return (
    <div>
      results screen
      {results?.length &&
        results.map((resultItem, index) => (
          <div key={`${resultItem.question}-${index}`}>
            {resultItem.isCorrectAnswer}
            {resultItem.question}
          </div>
        ))}
      <button type="submit" onClick={() => {}}>
        TRUE
      </button>
    </div>
  );
};
